import { Link } from "react-router-dom"
import { FaArrowCircleLeft } from "react-icons/fa"

export const BackButton = ({ url }) => {
  return (
    <Link to={url} className="btn btn-reverse btn-back">
      <FaArrowCircleLeft />
      Back
    </Link>
  )
}
